package com.poly.vo;

public class PolyParent {
	private String data;
	private int number;
	
	public PolyParent() {
		// TODO Auto-generated constructor stub
	}
	
	public PolyParent(String data, int number) {
		super();
		this.data = data;
		this.number = number;
	}

	public String getData() {
		return data;
	}

	public void setData(String data) {
		this.data = data;
	}

	public int getNumber() {
		return number;
	}

	public void setNumber(int number) {
		this.number = number;
	}
	
	
}
